import React from "react";

function ListLow() {
  const winners = [
    {
      year: 2025,
      color: "warning",
      link: "/list2025",
      external: true,
    },
    {
      year: 2024,
      color: "primary",
      link: "https://drive.google.com/file/d/1FprgaHepKiWxxrJxRXHEqeRtlpe_z_ue/view?usp=sharing",
      external: false,
    },
  ];
}

export default ListLow;
